import React from 'react';
import Navigation from './components/navigation';
import {
  createBrowserRouter,
  Router,
  RouterProvider,
} from "react-router-dom";

const navLinks = [
  {
      title: 'Home',
      path: '/'
  },
  {
      title: 'Blog',
      path: '/blog'
  },
  {
      title:'Contact',
      path:'/contact'
  },
  {
      title:'Shop',
      path:'/shop'
  },
  {
      title:'Login',
      path:'/login'
  },
  {   title:'Create',
      path: '/create'
  }

]



const router = createBrowserRouter(
  navLinks.map((link) => ({
    path: link.path,
    element: <div><Navigation/></div>,
  }))
);

function App() {
  return (
    <div>

      <RouterProvider router = {router}/>

    </div>
  );
}


export default App;
